-- https://rosalind.info/problems/kmer/

import Control.Monad (replicateM)
import Data.List (sort)

input = ""

group [] = []
group l = take 4 l : group (tail l)

main = putStrLn . unwords $ map count kmers
  where
    kmers = sort $ replicateM 4 "ACTG"
    count x = show . length . filter (== x) $ group input
